CREATE TABLE IF NOT EXISTS `session_reviews` (`id` int AUTO_INCREMENT NOT NULL, `sessionId` int NOT NULL, `reviewerId` int NOT NULL, `rating` int DEFAULT 0, `comment` text, `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY(`id`));
CREATE TABLE IF NOT EXISTS `sle_exam_sessions` (`id` int AUTO_INCREMENT NOT NULL, `userId` int NOT NULL, `examType` varchar(50) NOT NULL, `level` varchar(10), `score` int, `maxScore` int, `passed` tinyint(1), `duration` int, `answers` json, `feedback` text, `startedAt` timestamp, `completedAt` timestamp, `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY(`id`));
CREATE TABLE IF NOT EXISTS `user_permissions` (`id` int AUTO_INCREMENT NOT NULL, `userId` int NOT NULL, `module` varchar(100) NOT NULL, `action` varchar(100) NOT NULL, `allowed` tinyint(1) DEFAULT 1, `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP, `updatedAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP, PRIMARY KEY(`id`));
CREATE TABLE IF NOT EXISTS `webhook_events_log` (`id` int AUTO_INCREMENT NOT NULL, `source` varchar(100) NOT NULL, `eventType` varchar(200) NOT NULL, `payload` json, `status` varchar(30) DEFAULT 'received', `processedAt` timestamp, `error` text, `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY(`id`));
CREATE TABLE IF NOT EXISTS `audit_log` (`id` int AUTO_INCREMENT NOT NULL, `userId` int, `action` varchar(200) NOT NULL, `entityType` varchar(100), `entityId` int, `details` json, `ipAddress` varchar(50), `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY(`id`));

